-   model: flatpages.flatpage
    pk: 1
    fields:
        url: /about/
        title: About the CoGs Leaderboard Space
        content: "<h2>What are CoGs?</h2>\r\nCompetitive Gamers. Just a moniker for
            game players who like to\r\ncompete, specifically at tabletop games, sometimes
            going under the\r\nlabels of board games, card games, social games, Euro
            games, German\r\ngames.<br>\r\n<br>\r\nIn the ideal, CoGs are not people
            who are out to win at all costs,\r\nbut people who enjoy the thrill of
            competition, playing against well\r\nmatched opponents, balanced and exciting
            games.<br>\r\n<h2>What is a leaderboard?</h2>\r\nA list of all the players,
            of a given game ranked by some measure of\r\nperformance or skill. There
            are <a\r\nhref=\"http://www.pga.com/news/golf-leaderboard\">Golf leaderboards</a>,\r\n<a
            href=\"https://www.atpworldtour.com/en/stats/leaderboard\">Tennis\r\nleaderboards</a>,
            <a\r\nhref=\"https://www.chess.com/leaderboard/live\">Chess leaderboards</a>\r\nand
            more. The CoGs Leaderbard Space hopes provides a place to store,\r\nmanage
            and present leaderboards for any number of games (Golf\r\nexcluded ;-).\r\n<h2>Why
            leaderboards?</h2>\r\nLeaderboards are popular for a number of reasons:\r\n<ol>\r\n<li>
            They offer a meta-game or meta-competition, that surrounds a\r\ngiven
            game.<br>\r\nYou're not just competing with your opponents at a given
            game\r\nsession, but with all players over time, for long term rankings.\r\n</li>\r\n<li>
            They help plan balanced games.<br>\r\nPlayers at similar ranks can plan
            to play together, helping to\r\navoid runaway victories and create more
            in-game tension.<br>\r\n</li>\r\n<li> They promote replay and focus.<br>\r\nGet
            better at a game you like, play it again and again. This has\r\nparticular
            relevance in the tabletop gaming world where new\r\ngames are being published
            at unprecedented rates, and the\r\nnovelty factor of discovering and learning
            new games threatens\r\nto eclipse enjoyment of good-quality games. </li>\r\n</ol>\r\n<h2>How
            are players ranked on a leaderboard?</h2>\r\nWe use the <a\r\nhref=\"https://www.microsoft.com/en-us/research/project/trueskill-ranking-system/\">TrueSkill</a>\r\nalgorithm
            to estimate a players skill (or rating), measured in teeth\r\n(CoGs have
            teeth, after all) at a game based on the history of their\r\nplays of
            that game. We derive a rating using the recorded\r\nperformance (history
            of game placements), and rank players on a\r\ngiven leaderboard (for a
            given game) based on that rating.\r\nLeaderboards can be for a specific
            league or global.\r\n<h2>What is a league?</h2>\r\nA gaming league is
            simply a group of players who are interested in\r\nrunning a leaderboard
            against one another. It's a useful way of\r\ngrouping players who regularly
            play together. The CoGs Leaderboard\r\nSspace can present leaderboards
            that include only the players of a\r\nspecified league, or globally. Every
            player has a primary league\r\nnoted, and if they have an account and
            log in, then relevant&nbsp;\r\nviews will default to the primary league.
            Otherwise various views\r\ncan be filtered to show players, teams, games
            or sessions of one\r\nleague only.\r\n<h2>What's the Leaderboard Space?</h2>\r\nA
            place to track leaderboards for tabletop games. The Leaderboard\r\nSpace
            is where many leaderboards for tabletop games live (and are\r\nmanaged
            and presented). It is, at its heart, a database with a web\r\ninterface,
            as are most web sites today.\r\n<h2>What is stored in the CoGs Leaderboard
            space?</h2>\r\nWe aim to store everything needed to calculate TrueSkill
            ratings and\r\nnothing more. That is, primarily:\r\n<ul>\r\n<li> Basic
            player information.<br>\r\nIncludes an email for sending notifications
            if desired, and <a\r\nhref=\"http://boardgamegeek.com\">BoardGameGeek</a>
            ID if\r\ndesired, where more player information can be offered/found.
            </li>\r\n<li> Basic game information.<br>\r\nOnly details that help manage
            leaderboards. A <a\r\nhref=\"http://boardgamegeek.com\">BoardGameGeek</a>
            ID is stored\r\nfor each game where possible to provide links to further\r\ninformation.
            </li>\r\n<li> Session records.<br>\r\nEvery game session is time stamped,
            identifies the game played,\r\nthe league that it played in, a venue,
            the order that the\r\nplayers finished in and the portion of the game
            they played. </li>\r\n<li> Supporting information for those session records:<br>\r\nBasic
            summary information about leagues, venues and teams\r\n(groups of players
            playing together) </li>\r\n</ul>\r\n<h2>How is a TrueSkill rating calculated?</h2>\r\nThere's
            plenty to read about TrueSkill <a\r\nhref=\"https://drive.google.com/drive/folders/0B11fEatiLQkhMmlWSV9vTjlFNHM\">on-line</a>,\r\nbut
            in summary:\r\n<ol>\r\n<li>TrueSkill attempts to assess a player's skill
            at a given game.\r\n</li>\r\n<li>It acknowledges that skill is an uncertain
            thing, that we are\r\ntrying to assess (that is, we are unsure of a given
            player's\r\nskill). </li>\r\n<ul>\r\n<li>Therefore it models skill as
            a probability distribution (PD)\r\nrather than a value, which is one way
            of saying \"a player's\r\nskill is probably 'one value' but we're only
            'so' sure of\r\nthat\".</li>\r\n</ul>\r\n<li>Everyone is given the same
            initial skill PD </li>\r\n<li>Evidence, that is, game results, are used
            to modify the PD\r\nusing <a href=\"iki/Bayes%27_theorem\">Bayes' Theorem</a>.
            </li>\r\n<li>In general the expected value of skill tries to track\r\nperformance,
            and the confidence in that value rises with more\r\nand more evidence
            and declines slightly over time (absence of\r\nevidence). </li>\r\n</ol>\r\n<p>And
            with that in mind, a little more detail, with specific\r\nattention to
            how we at the CoGs Leaderboard Space use TrueSkill:</p>\r\n<p>A rating
            (in teeth) is assigned to each player for any given\r\ngame, which is
            a summary of the PD that TrueSkill has calculated\r\nfrom the evidence.</p>\r\n<p>In
            practice, the PD is modeled by a <a\r\nhref=\"https://en.wikipedia.org/wiki/Normal_distribution\">Gaussian\r\n\r\n\r\n\r\n\r\nor
            Normal distribution</a>, which can be described by two\r\nvalues, a <a
            href=\"https://en.wikipedia.org/wiki/Mean\">mean</a>\r\nand a <a href=\"https://en.wikipedia.org/wiki/Variance\">variance</a>\r\n(or
            <a href=\"https://en.wikipedia.org/wiki/Standard_deviation\">standard\r\n\r\n\r\n\r\n\r\ndeviation</a>).</p>\r\n<p>In
            layman's terms the Normal Distribution is the familiar bell\r\ncurve (hence
            it's name \"Normal\", because it's pretty often seen)\r\nand the mean
            describes where the peak of the bell is, while the\r\nvariance (or standard
            deviation) describes the width of the bell.\r\nA high variance is a wide
            bell, a low variance a narrow bell. <br>\r\n</p>\r\n<p>The mean can be
            considered the most likely skill and the variance\r\nis a measure of our
            uncertainty, or conversely our confidence.\r\nThat is, the lower the variance
            (the narrower the bell curve) the\r\nmore confident we are that skill
            is close to that mean. Conversely\r\nthe higher the variance (the wider
            the bell) the more uncertain we\r\nare about that mean.</p>\r\n<p>We can't
            use a bell curve to rank players though. We need a\r\nsingle value to
            rank players by, some assessment of skill. We\r\ncould choose the most
            likely value (the mean) and run with that.\r\nBut instead, as per TrueSkill's
            recommendation, we use a value\r\nthat we are very confident the skill
            is \"at least\", i.e. some\r\nvalue below the mean. The standard deviation
            is useful here. <br>\r\n</p>\r\n<p>If we used the mean as the rating,
            we're effectively saying that\r\nwe're 50% sure that the player's skill
            is at least this.<br>\r\n</p>\r\n<p>If we were to use the mean minus one
            standard deviation, we're\r\nsaying that we're about 84% sure that the
            player's skill is at\r\nleast that value. <br>\r\n</p>\r\n<p> If we were
            to use the mean minus two standard deviations, we're\r\nsaying that we're
            about 98% sure that the player's skill is at\r\nleast that value. <br>\r\n</p>\r\n<p>If
            we were to use the mean minus three standard deviations, we're\r\nsaying
            that we're about 99.9% sure that the player's skill is at\r\nleast that
            value. <br>\r\n</p>\r\n<p>TrueSkill by default uses the mean minus three
            standard\r\ndeviations to estimate skill (though it's configurable), so
            the\r\n99.9% confidence level. The skill we're 99.9% sure you at least\r\nhave!<br>\r\n</p>\r\n<p>Every
            time new evidence arrives (a new game result is recorded)\r\nthe TrueSkill
            PD is recalculated (using Bayes' Theorem) for each\r\nplayer who participated,
            and a new rating determined from the new\r\nPD. <br>\r\n</p>\r\n<h2>How
            do TrueSkill ratings behave?</h2>\r\n<p> There are some TrueSkill parameters
            that can be tuned either\r\nglobally or for a given game. On the whole
            though: </p>\r\n<ul>\r\n<li>Your rating at a given game will start at
            0 (precisely because\r\nthe initial PD has a mean that is three standard
            deviations\r\nabove zero) </li>\r\n<li>As you play games, win or lose,
            the standard deviation gets\r\nlower (i.e. the confidence in our assessment
            of your skill\r\nrises). This effectively raises your rating (because
            the mean\r\nminus three standard deviations goes up) - simply by playing
            the\r\ngame and recording the result. </li>\r\n<ul>\r\n<li>It will rise
            more quickly at first, and more slowly as more\r\nand more evidence is
            collected (i.e. game results are\r\nrecorded). </li>\r\n</ul>\r\n<li>After
            a given game is recorded some players' ratings will go\r\nup and others
            may go down. Winners tend to steal ratings from\r\nlosers.</li>\r\n</ul>\r\n<h2>Is
            TrueSkill perfect?</h2>\r\n<p>No, TrueSkill is not perfect. Nothing is.
            And there are some\r\nknown issues at present (waiting for you, if you're
            math whiz with\r\npassion and time or funding, to fix). Some of these
            will allow\r\nplayers to game the system so to speak. </p>\r\n<ul>\r\n<li>Rating
            risk: <br>\r\nBecause winners tend to steal ratings from losers, there's
            a\r\ndefinite risk to playing if your rating is high. <br>\r\nSo someone
            with a very high rating may feel inclined to protect\r\ntheir rating by
            not playing that game any more. <br>\r\nThe current leader so to speak
            on any leaderboard has only one\r\ndirection to go after all ... down.
            <br>\r\n<br>\r\n</li>\r\n<ul>\r\n<li>Ranking surprise:<br>\r\nTrueSkill
            introduces two rating trends. The first is that\r\nconfidence goes up
            with new evidence. <br>\r\n</li>\r\n<ul>\r\n<li>Every time you play, it
            gets more and more sure of your\r\nrating. This effect is strong at first,
            the difference\r\nbetween two game results and one is very large and\r\nconfidence
            responses appropriately. The difference between\r\nthree games results
            and two is a little less, and so on the\r\nmore evidence we collect the
            smaller the effect of any new\r\npiece of evidence. Which means that the
            rise in confidence\r\ngets smaller and smaller over time. <br>\r\n</li>\r\n<li>Over
            time, without any evidence (between games), skill is\r\nknown to vary
            (notably it declines a little without\r\npractice, but the bottom line
            is it varies). To model this\r\nTrueSkill reduces confidence a little
            with every skill\r\nupdate. <br>\r\n</li>\r\n</ul>\r\nIn time the diminishing
            rise in confidence (first effect)\r\nbecomes smaller than the decline
            in confidence (second effect)\r\nand a player can record a game result,
            win, and still go down in\r\nranking! We will keep an eye on this at the
            CoGs Leaderboard\r\nSpace and are in fact exploring ways to improve TrueSkill
            in\r\nthis space.<br>\r\n<br>\r\n</ul>\r\n<li>Strategic opponent selection:
            <br>\r\nIf you understand the algorithm well, it's conceivable to choose\r\nopponents
            which maximise the likelihood of a ratings improvement\r\nfor you. <br>\r\n<br>\r\n</li>\r\n<li>Biased
            draws: <br>\r\nYou'd expect in a draw that all drawing players experience
            the\r\nsame impact to their rating. <br>\r\nAlas, that is not guaranteed.
            TrueSkill can be fixed to secure\r\nthis, and at the CoGs Leaderboard
            Space we're giving that some\r\nthought (no promises yet).<br>\r\n</li>\r\n</ul>\r\n<p>All
            these issues can be fixed. Let's hope someone does. In the\r\nmean, time
            we feel TrueSkill is the best rating system available\r\nto gamers, and
            a bulk of the Chess fraternity (through the\r\nadoption of <a\r\nhref=\"https://en.wikipedia.org/wiki/Elo_rating_system\">Elo</a>)\r\nand
            the Xbox community (through the application of TrueSkill)\r\nagree. </p>\r\n<h2>Who
            runs this site?</h2>\r\nThe <a href=\"https://www.facebook.com/CoGsLeagueHobart/\">Competitive\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\nGamers
            League of Hobart</a> (CoGs Hobart). <br>\r\n<h2>What is the status of
            the site? </h2>\r\n<p><a\r\nhref=\"https://en.wikipedia.org/wiki/Software_release_life_cycle#Alpha\">Alpha</a>.\r\n</p>\r\n<p>There's
            an adage in innovation circles that if you release a\r\nproduct when it's
            ready, you've released too late! </p>\r\n<p>It's a very busy world out
            there, and time to market is more\r\nimportant than ever! Not that this
            site has a particularly\r\naggressive market strategy or grand aspirations.
            It's a service to\r\none small community of gamers in the first instance
            with readiness\r\nto grow if popularity rises and others want to join
            and help grow\r\nit. To wit, we're putting this out there well before
            it's ready,\r\nor anywhere near as complete as we'd like. There's a to-do
            list\r\nlonger than any current leaderboard (the tip of the iceberg is\r\nlisted
            on <a href=\"https://github.com/bernd-wechner/CoGs/issues\">github</a>)\r\nand
            it's not getting smaller in any hurry. <br>\r\n</p>\r\n<p> But the site
            works, and is being used for the CoGS Hobart\r\nLeague, day to day, so
            it's time it showed a public face, so that\r\nleague members can look
            up leaderboards and track results.</p>\r\n<h2>What technology does this
            site use?</h2>\r\nAside from TrueSkill, it's built using the <a\r\nhref=\"https://www.djangoproject.com/\">Django</a>
            web framework\r\n(written in <a href=\"https://www.python.org/\">Python</a>)
            and\r\nrunning at present on a <a\r\nhref=\"https://www.raspberrypi.org/products/raspberry-pi-2-model-b/\">Raspberry\r\n\r\n\r\n\r\n\r\nPi
            2</a> in someone's basement. So if it's a little or a lot\r\nsluggish
            and up-time is not guaranteed, you know why.\r\n<h2>What is the history
            of the CoGs Leaderboard Space?</h2>\r\n<p>In 2004 a small group of tabletop
            gaming enthusiasts started to\r\nrun the <a\r\nhref=\"https://groups.yahoo.com/neo/groups/HoGS_Tasmania/conversations/messages/4\">Hobart\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\nWinter
            Games nights</a> under the banner of <a\r\nhref=\"https://groups.yahoo.com/neo/groups/HoGS_Tasmania/info\">HoGS</a>,\r\nthe
            Hobart Games Society. <br>\r\n</p>\r\n<p>In 2012 the group was flourishing
            and a focus group and event was\r\ntabled: HoGS Hardcore, dedicated to
            competitive strategic gaming.\r\n<br>\r\n</p>\r\n<p>HoGS Hardcore was
            a response to two growing trends at HoGS weekly\r\ngames nights:<br>\r\n</p>\r\n<ol>\r\n<li>A
            struggle to bring hard core strategic games to the table for\r\nhead-on
            competition. <br>\r\nWith a steady influx of new gamers and a great diversity
            of\r\ngamers, a slight bias towards more accessible games emerged.</li>\r\n<li>A
            struggle to replay favourite games<br>\r\nWith the incredible growth in
            the game publication industry and\r\nin the gaming community, more and
            more players were assembling\r\nlarger and larger collections&nbsp; of
            games, resulting in a\r\nnever ending need to table new games. Novelty
            was eclipsing\r\nexperience.&nbsp;</li>\r\n</ol>\r\n<p>HoGS Hardcore was
            surprising popular, but not to everyone's taste\r\nand with some suggestion
            that it could lead to elitism so HoGS\r\nshelved the idea.</p>\r\n<p>In
            2014 the Hardcore group reformed as the CoGs League, running a\r\ncomplimentary
            monthly meet focused on competition and the idea of\r\nleaderboards.<br>\r\n</p>\r\n<p>CoGs
            started with a simple spreadsheet and scoring system to\r\ncalculate ratings,
            but couldn't settle on something fair that\r\nworked across all games
            irrespective of the number of players.\r\nThen they found TrueSkill.<br>\r\n</p>\r\n<p>2014
            was full of experimentation with TrueSkill. Some software\r\nlibraries
            turned up, notably in Python and C#, and a simple\r\nTrueSkill server
            was toyed with in Python<br>\r\n</p>\r\n<p>By 2015 CoGs decided to code
            up a website opting&nbsp; for the\r\nPython route and the Django web framework.<br>\r\n</p>\r\n<p>By
            late 2016 CoGs was managing leaderboards on its nascent web\r\nsite (running
            internally).<br>\r\n</p>\r\n<p>In early 2018 the website was deployed
            publicly to permit CoGs\r\nplayers to see leaderboards and play around
            with views and\r\nfilters.<br>\r\n</p>\r\n<h2>Can I help improve the site?</h2>\r\n<p>
            You sure can! Please!<br>\r\n</p>\r\n<p>To date it's had one developer
            only who can give it the likes of\r\n5 to 10 hours a month of effort,
            so the project is openly in need\r\nof contributors. </p>\r\nThe code
            base is all on <a\r\nhref=\"https://github.com/bernd-wechner/CoGs\">github</a>.&nbsp;\r\nAnyone
            can <a href=\"https://help.github.com/articles/fork-a-repo/\">fork</a>,\r\nand
            contribute. I hope there's enough in the <a\r\nhref=\"https://github.com/bernd-wechner/CoGs/blob/master/README.md\">ReadMe</a>\r\nto
            help anyone with some comfort with Python to implement locally,\r\nrun,
            debug, and see open issues.\r\n<p>If you're interested in helping the
            gaming community and\r\nespecially those who view competition as an important
            part of the\r\ngame, we'd welcome your help with this site. To discuss
            what you\r\nmight contribute feel free to write to us at&nbsp; to: competitive\r\ndot
            gamers dot hobart at gmail dot com (forgive the transparent\r\neffort
            to hinder spam robots harvesting the email address - we're\r\nhoping it
            works).<br>\r\n</p>"
